        user:{first,last,school,address,city,email,mobile}
    } = isAuthenticated();
    return (
        <Base title="Pariksha-Dashboard" 
        description=""
        className='container bg-info p-4'
        >
            <div className='row'>
                <div className='col text-light'>
                    <p>Welcome {first} {last}</p>
                </div>
            </div>
        </Base>
    )
}
